import React from "react";


class StudentView extends Component {
  render() {
  const { firstname, lastname, town, id, size, open} = props;
  console.log(open);
  switch (size) {
    case "SMALL": {
      return (
        <div>
          <p> {firstname} </p>
        </div>
      );
    }
    case "FULL_RESTRICTED": {
      return (
        <div>
          <p> {lastname} </p>
        </div>
      );
    }
    case "FULL": {
      return (
        <div>
          <p> {firstname} </p>
          <p> {town} </p>
          <p> {id} </p>
        </div>
      );
    }
    default:
      break;
  }
}
}

export default StudentView;
